import React, { Component } from 'react';
import $ from 'jquery'
import '../css/style.css'
import 'bootstrap/dist/css/bootstrap.min.css'

class UsuarioCliente extends Component{
    constructor(props){
        super();
    }    

    modificarFondo() {        
        $('#miBody').attr("id", "imagen-fondo1");
        location.reload();
    }

    render(){
        this.modificarFondo();
        return(            
            <p>Hola Que mas</p>        
        );
    }
}

export default UsuarioCliente;
